import React from "react";

function CountryJumbotron({ children }) {
  return (
    <div
      style={{ height: 300, clear: "both", paddingTop: 120, textAlign: "center", backgroundImage: "url('http://1.bp.blogspot.com/-vuO5ePAWmgM/VIoj1mGIBYI/AAAAAAAAB8w/odi6QCnVt5c/s1600/jacobs%2Bladder%2Btoy.jpg')" }}
      className="jumbotron"
    >
      {children}
    </div>
  );
}

export default CountryJumbotron;
